function Search(props){
  const { data, setData } = props;
  const [filters, setFilters] = useState([{ type: 'name', query: '' }]);

  // Filter the data based on the query string and filter type
  const filterData = () => {
      const filteredData = data.filter((row) => {
          for (let i = 0; i < filters.length; i++) {
              const filter = filters[i];
              const queryStr = filter.query.trim().toLowerCase();

              if (filter.type === 'name' && !row.name.toLowerCase.includes(queryStr)) {
                  return false;
              } else if (filter.type === 'pressure' && !row.pressure.toLowerCase().includes(queryStr)) {
                  return false;
              } else if (filter.type === 'serialnum' && !row.serialnum.toLowerCase().includes(queryStr)) {
                  return false;
              }else if (filter.type === 'date' && !row.date.toLowerCase().includes(queryStr)) {
                  return false;
              } else if (filter.type === 'jobnum' && !row.jobnum.toLowerCase().includes(queryStr)) {
                  return false;
              }
          }
          return true; // All filters passed
      });
      setData(filteredData);
  };

  // Add a new filter
  const addFilter = () => {
      setFilters([...filters, { type: 'name', query: '' }]);
  };

  // Remove a filter by index
  const removeFilter = (index) => {
      const newFilters = [...filters];
      newFilters.splice(index, 1);
      setFilters(newFilters);
  };

  return(
      <div className='filterSection'>
          {filters.map((filter, index) => (
              <div key={index}>
                  <input 
                      type="text" 
                      placeholder="Search..." 
                      value={filter.query} 
                      onChange={(e) => {
                          const newFilters = [...filters];
                          newFilters[index] = { ...filter, query: e.target.value };
                          setFilters(newFilters);
                          filterData(); // Filter the data dynamically
                      }} 
                  />

                  <select 
                      value={filter.type} 
                      onChange={(e) => {
                          const newFilters = [...filters];
                          newFilters[index] = { ...filter, type: e.target.value };
                          setFilters(newFilters);
                          filterData(); // Filter the data dynamically
                      }}
                  >
                      <option value="tech_name">Name</option>
                      <option value="pressure_value">Pressure Value</option>
                      <option value="date_collected">Date</option>
                      <option value="job_num">Job Number</option>
                      <option value="serial_num">Serial Number</option>
                  </select>

                  <button onClick={() => removeFilter(index)}>X</button>
              </div>
          ))}

          <button onClick={addFilter}>Add filter</button>
          <button onClick={filterData}>Filter</button>
          <button onClick={() => {setData(data); setFilters([{ type: 'name', query: '' }]);}}>Reset</button>
      </div>
  )
}

export default Search;




